import React from 'react';
import SearchBar from './SearchBar.jsx';
import '../hoja-de-estilos/Nav.css';

function Nav({ onSearch }) {
  return (
    <div>
      <nav
        className="navbar
       fixed-top
        navbar-expand-lg
        navbar-dark
        bg-dark

      "
      >
        <div className="navbar_container">
          <SearchBar onSearch={onSearch} />
        </div>
      </nav>
    </div>
  );
}

export default Nav;
